window.bookSummaryJSON = "<p>Don't blink. Nearly 7,000 ago, a priceless piece of history vanished in the Caucasus Mountains near Armenia.</p> <p>The thrilling finale of The Lost Chambers trilogy sends former government agent Sean Wyatt and his sidekick Tommy Schultz deep into the heart of some of the oldest mountains in the world in search of a treasure that many believed were lost to antiquity. </p> <p>While the two and their new friend Adriana Villa race toward their goal, they encounter deadly villains and a man with an evil plan that could wipe out most of civilization.</p>"; 
